import React, { Component } from 'react'

 class Student extends Component {
    constructor(probs){
        super(probs)
    }
  render() {
    const {name, skill, photo}=this.probs;
    return (
       
        <div className="col-md-4">
        <div className="team">
            <img src={photo} alt="" />
            <h2>{name}</h2>
            <p>{skill}</p>
        </div>

    </div>
    )
  }
}



export default Student;
